                    <label>{{ isFavData.value }}</label>
                    <div class="fav-button" @click="addFav()" v-if="!isFavData">
                        <v-icon class="heart-text" icon="mdi-heart-outline" />
                    </div>
                    <div class="fav-button" @click="removFav()" v-else>
                        <v-icon class="heart-text" icon="mdi-heart" />
