<script setup>
import { useFavoriteData } from '~/scripts/Backend';

const favData = useFavoriteData();

const props = defineProps({
    formOpen: Boolean,
    setCloseForm: Function,
    formData: Object,
});

const isFavData = ref(favData.SearchData(props?.formData?.id));

const closeForm = () => {
    props.setCloseForm(false);
}

const addFav = () => {
    let favQuery = favData.data.filter(res => res?.id === props?.formData?.id);
    if (favQuery.length > 0) {
        return;
    }
    favData.setData(props?.formData);
    isFavData.value = true;
}

const removFav = () => {
    let newData = favData.data.filter(res => res.id !== props?.formData.id);
    favData.updateData(newData);
    isFavData.value = false;
}

watch(() => favData.data, (newData) => {
    isFavData.value = newData.some(res => res.id === props?.formData?.id);
});

watch(() => props?.formData, (newData) => {
    isFavData.value = favData.SearchData(props?.formData?.id);
});
</script>